import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import { BrowserRouter as Router,Route, BrowserRouter } from "react-router-dom";


function App() {
  return (
      <div className="App">
          <BrowserRouter>
          <Router>
            <Route>
          <Navbar/>
          <Footer/>

            </Route>
          </Router>
          
          </BrowserRouter>
          
          
      </div>
  );
}

export default App;
